script: |
  super -f text -I q7099.spq | sort > q7099.out

inputs:
  - name: q7099.spq
    data: |
      SELECT ALL + col2 * + CAST ( NULL AS INTEGER ) * - 23 * col1 - CAST ( NULL AS REAL ) AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( + - col0 ) NOT IN ( + + col0 * - col0 * - col2, CAST ( + - 14 AS INTEGER ) + + 2 - - 95, - + 60 + 59 - col0, + col0 );
  - name: tab2

outputs:
  - name: q7099.out
    data: |
